import React from 'react';
import LogoNumeroUno from './Images/Cocktail-icon.png';

const Header = (props) => {
	return (
		<div className="image-container" id="icon-header">
			<img src={LogoNumeroUno} alt="LogoNumeroUno" height="64px" width="64px" />
			<div className="text-over-image-right">
				<span
					style={{ fontSize: '3vh', fontWeight: '600', color: 'antiquewhite' }}
				>
					Numero
				</span>
			</div>
			<div className="text-over-image-right-down">
				<span style={{ fontSize: '3vh', fontWeight: '600' }}>Uno</span>
			</div>
		</div>
	);
};

export default Header;
